import React from "react";
import { Link } from "react-router-dom";
import Atendimentos from "../../layouts/Atendimentos";
import Prontuarios from "../../layouts/Prontuarios";
import AreaPaciente from "../../layouts/AreaPaciente";
import Agenda from "../../layouts/Agenda";
import Profissionais from "../../layouts/Profissionais";
import SobreSistema from "../../layouts/Sobresistema";
import Rodape from "../../layouts/Rodape";
import gif from '../../assets/Logo.gif';
import "../../css/telaInicial.css";
import {
  FaRegHospital,
  FaHandHoldingMedical,
  FaNotesMedical,
  FaUser,
  FaRegCalendarAlt,
  FaUserMd,
} from "react-icons/fa";

const TelaInicial: React.FC = () => {
  return (
    <div>
      <div className="container">
        <header>
          <div className="interface">
            <img src={gif} alt="Logo do Hospital"/>cls
            <nav>
              <Link to="/tela-inicial">
                <FaRegHospital /> Home
              </Link>
              <Link to="/atendimentos">
                <FaHandHoldingMedical /> Atendimentos
              </Link>
              <Link to="/prontuarios">
                <FaNotesMedical /> Prontuários
              </Link>
              <Link to="/area-paciente">
                <FaUser /> Área do Paciente
              </Link>
              <Link to="/agenda">
                <FaRegCalendarAlt /> Agenda
              </Link>
              <Link to="/profissionais">
                <FaUserMd /> Profissionais
              </Link>
            </nav>
          </div>
        </header>
      </div>

      <SobreSistema />

      <section>
        <Atendimentos />
      </section>

      <section>
        <Prontuarios />
      </section>

      <section>
        <AreaPaciente />
      </section>

      <section>
        <Agenda />
      </section>

      <section>
        <Profissionais />
      </section>

      <Rodape />
    </div>
  );
};

export default TelaInicial;
